       5-George Ray (KY), Lenclud, F, finished 5;

Osteotomia e Curetagem na Cirurgia Paraendodôntica - Equipe de Endodontia de Campinas

Caso a cortical óssea vestibular esteja intacta deve-se fazer uma avaliação do comprimento radicular na radiografia (com auxílio de uma lima endodôntica, por exemplo) com o objetivo de se iniciar a cavidade óssea. O início do acesso deve ser realizado com uma broca esférica carbide compatível ou broca tronco-cônica carbide nº701, complementado com broca Zekrya cirúrgica. A cavidade óssea deve permitir um ótimo acesso à lesão e ao ápice radicular;

Remoção/ curetagem da lesão perirradicular - o tecido lesado deve ser removido por uma cureta cirúrgica afiada de tamanho compatível, com a superfície convexa em direção a parede do defeito ósseo. Neste momento deve ser realizada farta irrigação com soro fisiológico;
